measurements.description:
One stately flat full flower on one sturdy 25.5-cm inflorescence; 
	dorsal sepal white, veined green-brown, overlaid green basal half, transitioning to light burgundy on marginal two-thirds; 
	synsepal green, burgundy stripes; 
	petals green basal half transitioning to medium burgundy marginally, heavy dark mahogany warts, upper margin hirsute; 
	pouch burgundy, veined darker burgundy; staminode pale green, darker green centrally; 
	substance medium; texture waxy.
